import React from 'react';
import { Consumer } from './AppProvider';

class Header extends React.Component{
    render(){
        return(
            <Consumer>{({ state, ...context }) => (
                state.currentUser ?
                    <div className="main">
                        Hello
                    </div>
                    :''
                )
            }</Consumer>
        )
    }
}

export default Header
